INSERT INTO `tb_base_jx` VALUES ('9f4d700e-54c4-4843-8ff0-3fcff6661682', '广州程通驾校', '程通驾校', '020-34313351 ', '13729896381', '740622332', 'http://pic1.58cdn.com.cn//www/uploadfile/n_s12705200539882385192_a6651ce5d24d756d.jpg', '本驾校是广州市AAA级优秀质量培训企业，成立于1996年至今已经超过13多年的历史，培训无数合格的驾驶员，每年评为市级先进单位，得到广泛好评，程通拥有200多台教学车，包括多台全新自动档轿车，每年培训合格的驾驶员12000多人。短短十几年间本机构飞快发展，分点遍布全市各区，学车已经达到完善服务质量，拥有最优质的场地，最好的师资力量，成为现广州市十优的驾驶培训之一。 本中心是一个具有专业优秀人才，多年丰富的教学经验、一流的服务、一流素质的汽车驾驶培训中心。在我们驾校学车，我们采用全崭新的捷达桥车、自动档位桥车，庞大的师资队伍可以让你享受最满意的教学服务。掌握到多一门技术之如，还可以让你感受到学车的乐趣。 \r\n    综合训练部座落在广州天河岑村苗圃路段，规模宏大，还在该路段自建了一个占地面积为40000平方米绿化环境优美的“9选6”综合训练场。', '广州市海珠区新港东路', '2015-04-20 15:25:22', '2015-04-20 15:25:30', 'HF', '合法', '广州学车当然到程通，完善的教学驾学校 \r\n1：所有上课考试，均可接送。离岑村只有十分钟车程让学员可以更方便，轻松！领了驾驶证后可继续来学车； \r\n2：多名资深教练亲身指导，绝对保障学员的安全和教学； \r\n3：学车时间非常弹性，随你安排随意组合，合适各学员口味； \r\n4：采用捷达轿车教学，让学员拥有舒适的教学环境，车内装有空调设备，冬暖夏凉便可以使您更专心学车； \r\n5：相比其他培训中心的服务质量更胜一筹，承诺真诚服务，以礼代人，做好学习风气，让你更放心，保证考到驾驶执照，免去您的后顾之忧； \r\n6：所考取的驾驶执照全国通用，驾驶证可随时转回你的所在地； \r\n7：考试费学费一次性收取，以后绝不再交收任何费用。');

