INSERT INTO `tb_subject` VALUES ('351742ee-ebcc-40cc-b5fc-fb3a39131e14', '科目三', '机动车驾驶人考试中道路驾驶技能和安全文明驾驶常识考试科目', 'C1S3', '科目三道路驾驶技能和安全文明驾驶常识考试满分分别为100分，成绩分别达到90分的为合格。', '1', 'C1', 'C1', '1', '1', '0', '2015-04-16 10:18:58', null, null);
INSERT INTO `tb_subject` VALUES ('de9581d9-d016-470b-9126-ae297b673e57', '科目二', '场地驾驶技能考试科目', 'C1S2', '科目二考试一次，考试不合格的，可以补考一次。不参加补考或者补考仍不合格的，本次考试终止，申请人应当在十日后重新预约考试。在驾驶技能准考证明有效期内，科目二和科目三道路驾驶技能考试预约考试的次数不得超过五次。第五次预约考试仍不合格的，已考试合格的其他科目成绩作废。', '1', 'C1', 'C1', '1', '1', '0', '2015-04-16 10:15:10', null, null);

